import { TextField } from '@mui/material';
import './App.css';

function App() {
  return (
    <div>
      <h1>Hello World !</h1>
      <TextField placeholder='helo' variant='outlined' color='primary'>Hello</TextField>
    </div>
  );
}

export default App;
